import React from 'react';
import Card from './Card';
const Cardlist=({filterrobots})=>{
	const Cardcomponent=filterrobots.map((user,i)=>{
		return <Card key={i} 
		id={filterrobots[i].id} 
		name={filterrobots[i].name} 
		email={filterrobots[i].email}
		number={filterrobots[i].number}
		depart={filterrobots[i].depart} 
		arrive={filterrobots[i].arrive}
		prix={filterrobots[i].prix}
		date={filterrobots[i].date}
		hd={filterrobots[i].heureDepart}
		ha={filterrobots[i].heureArrivee}/>
	})
	return (
	<div>
 		{Cardcomponent};
   	</div>);
}

export default Cardlist;
